import logo from './assets/logo.png';

export default function Topo() {
  return(
    <header>
      <div>
        <img src="/assets/logo.png" alt="logomarca"/>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/sabores">Sabores</Link>
          <Link to="/sobre">Sobre</Link>
        </nav>
      </div>
    </header>
  )
}
